(415, 46, 63, 4, 'Dear Alpha,\r\n\r\nI wish to bring to your attention  the EXTREMELY CARING & professional work ethic Pontshiso gave me when I had quite a hitch with my credit & debit cards! If not for her I would of closed my accounts & gone to FNB! Even though I have been a loyal ABSA client for over 15 years. But thanks to Pontshiso !  absa will be stuck with me for at least the next 15 years!\r\n\r\nLook after her she worth a pot of gold!\r\n\r\nHave a great day!\r\n\r\nKind Regards\r\n\r\nBrad Presto\r\n \r\nHall Real Estate Head Office\r\n\r\nt. 011 579 3700\r\nf. 086 562 6100\r\nc: 082 604 9819\r\nc: 072 898 9523\r\na. 67 Van Buuren Road, Bedfordview 2007\r\ne. brad@hallreal.co.za\r\nw. www.hallrealestate.co.za', 'Compliment', 'customer', 5, 8, 2018, '2018-08-30 17:33:33'),
(416, 26, 63, 4, 'Dear Mr Ngwenya\r\nI wish to bring to your attention that Mr Ramorafi is on the ball. His focus is ''on the money''. I woke up deeply perturbed by the failure by Absa to call me on Friday. I started testing the wechat function and he came online. When I spoke of a serious situation about the homeloan, he asked for my contact after which he immediately called me. \r\nThe call gave me confidence that my wish will be granted. I hope the home loan section will get their house in order. \r\nI wish to say thank you Mr Ramorafi. You brightened my day!\r\nKind Regards\r\nMakwara C.', 'Compliment', 'customer', 5, 8, 2018, '2018-08-30 17:35:09'),
