(688, 39, 60, 2, 'Failures Identified:\r\n1.	Template Error (The customer’s client code was not included in the header)\r\n2.	FPOC Error (Investigation would have revealed additional information that could have been provided to the customer: the reason the customer asked whether his card can be used online, is because of attempted online transactions that were declined. Further investigation would have revealed that the transactions were declined due to insufficient funds on his account)\r\n3.	Survey Error (The customer was not invited to complete the survey)', 'Comment', NULL, 1, 9, 2018, '2018-09-04 14:42:05'),
(689, 36, 60, 2, 'Failures Identified:\r\n1.	Salutation Error (Incorrect: Dear Candice  /  Correct: Dear Candice) (Names should always be capitalised)\r\n2.	Word Space Error (Ensure correct spacing between words)  \r\n3.	Punctuation Error (A required full stop was omitted at the end of a sentence)\r\n4.	PCI DSS Error (For the purpose of PCI DSS (Payment Card Industry Data Security Standards), please remember to remove sensitive customer information from the email trail (i.e. ID- and account numbers)\r\n\r\nAdditional Notes:\r\n1.	Formatting: Information in the subject line should not be changed from what the customer originally inserted there, unless personal customer information (i.e. an ID- and/or account number) is removed from the subject line.', 'Comment', NULL, 1, 9, 2018, '2018-09-05 10:37:23'),
(690, 40, 60, 2, 'Failures Identified:\r\n1.	Salutation Error (The customer should be addressed on the name they used in their email signature)\r\n2.	Template Error (Blank information [client code field] was not removed from the template) (Always ensure that unnecessary information/blank fields are removed from a template; failing to this creates the impression that information was accidentally left out or forgotten to be included, which may be deemed unprofessional)\r\n3.	Bullet Format Error (All points in the same numbered or bulleted list should be stated in the same format i.e. it should all be in the form of statements or all in the form of questions, in order to create a consistent format)\r\n4.	Capitalisation Error (Incorrect: Absa rewards  /  Correct: Absa Rewards) (Names are always capitalised)\r\n\r\nAdditional Notes:\r\n1.	A CCP complaint (reference 3617611) was logged with by Actionline on 4 September and they are busy with an investigation', 'Comment', NULL, 1, 9, 2018, '2018-09-05 13:32:37'),
(691, 41, 60, 2, 'Failures Identified:\r\n1.	Salutation Error (The customer should be addressed on the name they used in their email signature)\r\n2.	Template Error (Please ensure that when documents are attached to customers’ responses, it be done on letterheads with the new Absa logo and without the “Member of Barclays” logo) \r\n3.	Format Error (Please ensure that you use the same font type, -colour and -size throughout your response) \r\n4.	Punctuation Error (A comma was incorrectly used, instead of a colon)\r\n5.	Punctuation Error (A required comma was omitted)\r\n6.	Punctuation Error (A required colon was omitted)\r\n7.	Capitalisation Error (Incorrect: A Copy of your Passport  /  Correct: A copy of your Passport)\r\n8.	Capitalisation Error (Incorrect: A Signature specimen  /  Correct: A signature specimen)', 'Comment', NULL, 1, 9, 2018, '2018-09-05 14:26:14'),
