(696, 38, 59, 2, 'ENQ. Possible Fraud: Customer called in for a replacement card, but this is a possible fraudster who could not provide the correct answers to the security questions. Bellah successfully referred the customer to the branch as she identified that the caller failed all security questions. Bellah followed the correct procedure as well, with regards to not providing the customer with the correct answers.		\r\n\r\n-The customer could not pronounce his own full names.		\r\n-Customer was referred to the branch because she suspected possible fraud.	\r\n-Call ending not applicable - not measure.		\r\n-Rate my Service not applicable - not measured.	\r\n-Anything else not applicable - not measured', 'Comment', NULL, 1, 9, 2018, '2018-09-05 15:22:17'),
