(698, 40, 59, 2, 'ENQ. The customer enquired about a declined transaction.						\r\n\r\n-Thomas, you failed to ask the customers email address and cellphone number, this is due to you engaging in conversation whilst busy with your security checks. Please keep the calls professional at all times. Do not become to familiar with your customers. This has been addressed with you previously. Going forward this will be escalated.	\r\n-This call was not ended on a high note. When asking your customer to rate your service, you must still end the call on a high note by greeting your customer. You have been penalised for this on numerous calls. We also had a discussion about this last week. Going forward please end the call as required to ensure a pleasant customer experience.', 'Comment', NULL, 1, 9, 2018, '2018-09-05 15:31:54'),
