(701, 44, 60, 2, 'Failures Identified:\r\n1.	Salutation Error (Incorrect: Dear Sdu  /  Correct: Dear Sduduzo) (Customers should be addressed on the name they used in their email signature)     \r\n2.	Sentence Structure Error (Incorrect: kindly find your attached proof of payment as requested  /  Correct: kindly find attached your proof of payment as requested)   \r\n3.	Paragraph Error (Remember: one theme should be addressed in one paragraph; one idea should be discussed in one sentence)            \r\n\r\nAdditional Notes:\r\n1.	The customer could have been informed of different channels to obtain a proof of payment', 'Comment', NULL, 1, 9, 2018, '2018-09-06 10:36:36'),
(702, 51, 59, 2, 'ENQ. The customer called in to activate his card again, after he stopped it thinking that the card was lost.		\r\n\r\nThe agent did not use the customers name during the call to ensure that the conversation is personal		\r\nThe agent exceeded the hold time of 60 seconds. 		\r\nIn line with the NCA we are by law required to provide customers with statements of accounts. We wont be able to do so, if we do not confirm and verify the correctness of an email address.', 'Comment', NULL, 1, 9, 2018, '2018-09-06 11:08:14'),
(703, 43, 59, 2, 'Additional channel offered to customer		\r\nTo safeguard the privacy and protection of our customers personal data we must always identify the account holder by verifying full initials and surname.', 'Comment', NULL, 1, 9, 2018, '2018-09-06 11:25:00'),
(704, 44, 59, 2, 'ENQ. The customer is currently in England and wanted to know if his card is activated	\r\nA0-Full SARB regulations was not explained to the customer. The agent failed to mention that Residents who are over the age of 18 years going abroad may spend up to R1million per calendar year.', 'Comment', NULL, 1, 9, 2018, '2018-09-06 11:30:14'),
(705, 45, 59, 2, 'ENQ. 2 years statement requested.						\r\nTo safeguard the privacy and protection of our customers personal data we must always identify the account holder by verifying full initials and surname. The agent failed to verify the customer.	\r\nThe agent did not use the customers name during the call to ensure that the conversation is personal		\r\nA0- A brief description (memolines) of what the call was about, must be placed on the account. The purpose of this is to protect the bank and our agents,  and to provide a clear history of all interactions with our customers as well as for auditing purposes. The agent failed to place a memoline on the customers account. 		\r\nRate my Service measured under "applying the correct procedure - criteria"  - The agent failed to ask the customer to rate the service.', 'Comment', NULL, 1, 9, 2018, '2018-09-06 11:40:50'),
(706, 46, 59, 2, 'ENQ. Customer bought tickets and requested we place the transaction on budget	\r\n"A0-In line with the NCA we are by law required to provide customers with statements of accounts. We wont be able to do so, if we do not confirm and verify the correctness of an email address. Please update the customers email address to HILTON@PHINC.CO.ZA  (Currently incorrect email address: HILTON@THINK.CO.ZA)', 'Comment', NULL, 1, 9, 2018, '2018-09-06 11:44:13'),
(707, 47, 59, 2, 'ENQ. Overseas notification', 'Comment', NULL, 1, 9, 2018, '2018-09-06 11:46:22'),
(708, 48, 59, 2, 'ENQ. Customer enquired about a transaction						\r\nRate my Service measured under "applying the correct procedure - criteria"  - The agent failed to ask the customer to rate the service.', 'Comment', NULL, 1, 9, 2018, '2018-09-06 11:50:44'),
(709, 35, 60, 2, 'Failure Identified:\r\n1.	Conclusion Error (The chat was not properly concluded with an appropriate ending)', 'Comment', NULL, 1, 9, 2018, '2018-09-06 13:55:15'),
(710, 6, 59, 2, 'ENQ. Customer cannot transact in Mauritius		\r\nA0-To safeguard the privacy and protection of our customers personal data we must always identify the account holder by asking the customer to provide his/her full initials and surname. The agent are not allowed to verify the accountholders details by providing it to the customers. He might just be providing the details to a fraudster.  								\r\nCIF- The agent did not confirm a cellphone number of the customer.		\r\nA0-The agent only obtained 1 correct answer out of 4 security questions asked.								\r\nThe agent did not use the customers name during the call to ensure that the conversation is personal		\r\nUncomfortable silence identified								\r\nA0- A brief description (memolines) of what the call was about, must be placed on the account. The purpose of this is to protect the bank and our agents,  and to provide a clear history of all interactions with our customers as well as for auditing purposes. The agent failed to place a memoline on the customers account. 	\r\nThe customer is in Mauritius currently and she could not transact at all. Customer was transferred to the fraud department. This is incorrect procedure as you could have assisted her, by checking what went wrong on the account. In this case there was no fraud detected (the only note that can be seen is on 20 Aug 2016). You informed the customer that this was a fraudulent transaction. You could have placed the travel notes yourself (as this is what Fraud did – because there was no hold)	\r\nFraud number not provided.', 'Comment', NULL, 1, 9, 2018, '2018-09-07 12:46:05'),
(711, 46, 60, 2, 'Failures Identified:\r\n1.	Punctuation Error (A required semi-colon or comma was omitted) (A comma or colon is always used before "however" and a comma after “however”, when it is used in the middle of a long sentence where two independent clauses are connected)\r\n2.	Punctuation Error (A required comma was omitted) (When a sentence is started with an introductory dependent clause, a comma is used between this clause and the rest of the sentence)\r\n3.	FPOC Error (The response refers to an “Income and Expenditure form”, however, no such form was attached to the response)', 'Comment', NULL, 1, 9, 2018, '2018-09-07 12:52:09'),
(712, 7, 59, 2, 'ENQ. Overseas notification				\r\nA0-the agent only asked 2 security questions. The requirement is 3 security questions to be asked and verified.		\r\nA0- A brief description (memolines) of what the call was about, must be placed on the account. The purpose of this is to protect the bank and our agents,  and to provide a clear history of all interactions with our customers as well as for auditing purposes. The agent failed to place a memoline on the customers account. Furthermore the agent failed to place a travel note on Plastic, Account and SSCT trav/Falcon			\r\nA0-In line with the NCA we are by law required to provide customers with statements of accounts. We wont be able to do so, if we do not confirm and/or verify the correctness of an email address.', 'Comment', NULL, 1, 9, 2018, '2018-09-07 13:00:19'),
(713, 28, 59, 2, 'ENQ. Garage card closure\r\nEmail address not confirmed\r\nFailure to answer the call in 3 seconds as required\r\nHold time exceeded\r\nIncorrect procedure followed with regards to closing a garage card. Customer was not advised that the card should be destroyed.', 'Comment', NULL, 1, 9, 2018, '2018-09-07 13:07:05'),
(714, 47, 60, 2, 'Additional Notes:\r\n1.	Template Adjustment: Rather remove unnecessary information from the template, instead of indicating “N/A” next to it (i.e. for instance, when you are not able to populate the Client Code field, rather remove that line from the template altogether, instead of populating it with “N/A”).', 'Comment', NULL, 1, 9, 2018, '2018-09-07 13:08:34'),
(715, 9, 59, 2, 'ENQ. Customer called in to arrange a payment. Transferred to collections\r\nTo safeguard the privacy and protection of our customers personal data we must always identify the account holder by verifying full initials and surname. The agent failed to verify the customer in full.', 'Comment', NULL, 1, 9, 2018, '2018-09-07 13:13:50'),
(716, 13, 59, 2, '"ENQ. Customer enquired about a unknown transaction on his account THOMAS COOK 88135 N      5,207.87\r\n\r\nCIF: Agent failed to ask the customer to confirm a contact number for marketing, communication and notification purposes.	\r\nAnything else not measured as the customer was transferred to Fraud department								\r\nCall ending not measured as the customer was transferred to Fraud department								\r\nRate my Service not measured as the customer was transferred to Fraud department', 'Comment', NULL, 1, 9, 2018, '2018-09-07 13:17:55'),
(717, 12, 59, 2, 'ENQ. Credit card limit decrease			\r\nThe agent exceeded the hold time of 60 seconds. 	\r\nThe agent did not confirm with the customer the second email address we have on our system. If more than one email address reflects on CAML, the agent must ask the customer if this email should be removed or not.', 'Comment', NULL, 1, 9, 2018, '2018-09-07 13:26:18'),
(718, 11, 59, 2, 'ENQ. Credit card limit decrease						\r\nThe agent did not use the customers name during the call to ensure that the conversation is personal	\r\nUncomfortable silence identified	\r\nA0- A brief description (memolines) of what the call was about, must be placed on the account. The purpose of this is to protect the bank and our agents,  and to provide a clear history of all interactions with our customers as well as for auditing purposes. The agent failed to place a memoline on the customers account. 		\r\nAnything else not asked.								\r\nCall not ended on a high note.								\r\nRate my Service measured under "applying the correct procedure - criteria"  - The agent failed to ask the customer to rate the service. Rate my Service is applicable to branch calls too.', 'Comment', NULL, 1, 9, 2018, '2018-09-07 13:29:32'),
(719, 21, 59, 2, 'ENQ. Overseas travel 					\r\nThe agent did not use the customers name during the call to ensure that the conversation is personal			\r\nThe customer clearly stated that she is calling on behalf of her boss, in which you responded "for your husband?" The customer also had to repeat the account holders name twice.								\r\nA0- A brief description (memolines) of what the call was about, must be placed on the account. The purpose of this is to protect the bank and our agents,  and to provide a clear history of all interactions with our customers as well as for auditing purposes. The agent failed to place a memoline on the customers account. 								\r\n								\r\n								\r\nRate my Service not measured as the customer does not have signing power								\r\nAnything else not measured as the customer does not have signing power								\r\nCall not ended on a high note.								\r\n					\r\n								\r\n								\r\nThe agent did not request the customers permission to be placed on hold. The agent failed to provide the customer with a reason to be placed on hold. The customer must have a clear understanding why he/she is being placed on hold. 								\r\nThe agent exceeded the hold time of 60 seconds.', 'Comment', NULL, 1, 9, 2018, '2018-09-07 13:34:10'),
(720, 45, 60, 2, 'Failures Identified:\r\n1.	Punctuation Error (A required full stop was omitted at the end of a sentence) \r\n2.	Format Error (Incorrect: 3MONTHS BANK STATEMENT  /  Suggested Correction: Three Months’ Bank Statements OR Three months’ bank statements) (Information you include in the subject line should conform to the same writing rules as the content of your email)', 'Comment', NULL, 1, 9, 2018, '2018-09-07 13:37:44'),
(721, 24, 59, 2, 'ENQ. CLI and Close petrol card						\r\nA0-To safeguard the privacy and protection of our customers personal data we must always identify the account holder by verifying full initials and surname. The agent failed to verify the customer.		\r\nA0-The agent asked the customer five security questions in which the customer answered the first two incorrectly and the last three correct. The agent followed the incorrect procedure by referring the customer to the branch. The agent could have assisted the customer. Please refer to VB internal comms sent out 28 June. Furthermore, Rate my Service measured under "applying the correct procedure - criteria"  - The agent failed to ask the customer to rate the service. Rate my Service is applicable to branch calls too.', 'Comment', NULL, 1, 9, 2018, '2018-09-07 13:40:54'),
(722, 30, 59, 2, 'Enq. Travel notes\r\nAnything else not asked', 'Comment', NULL, 1, 9, 2018, '2018-09-07 13:43:07'),
(723, 22, 59, 2, 'ENQ. Overseas travel				\r\nCall not ended on a high note. Before transferring the customer to Rate my Service, the agent must still end the call on a high note.\r\nTo safeguard the privacy of our customers personal data, an open line must be avoided at all times. An open line is considered to be uncomfortable silence, caused by the agent, that exceeds 20 seconds. The agent should keep the conversation flowing.', 'Comment', NULL, 1, 9, 2018, '2018-09-07 13:46:40'),
