(725, 23, 59, 2, 'ENQ. Overseas travel		\r\nFICA verification not memolined and then incorrect departure date captured.	\r\nSARB regulations incorrectly provided to the customer. The agent said to the customer that there is a "R51.00, more or less" cash withdrawal fee. This is incorrect. The cash withdrawel fee is R60.53						\r\nA0-In line with the NCA we are by law required to provide customers with statements of accounts. We wont be able to do so, if we do not confirm and verify an email address. Furthermore the agent failed to confirm a cellphone number and email address for communication and notification purposes. Please refer to VB internal communication sent out on the 28th of June.', 'Comment', NULL, 1, 9, 2018, '2018-09-07 13:52:58'),
(726, 26, 59, 2, 'ENQ. Balance enquiry			\r\nThe agent did not use the customers name during the call to ensure that the conversation is personal							\r\nFICA verification not memolined.	\r\nRate my Service not measures as the  customer ended the call.								\r\nCall not ended on a high note.', 'Comment', NULL, 1, 9, 2018, '2018-09-07 13:56:52'),
(727, 49, 59, 2, 'A0-The agent is not allowed to provide any information with regards to the security questions. When the agent could not answer the next of kin, the agent said that it is his wife. Furthermore the agent only obtained 2 correct answers out of 3 security questions asked.								\r\nTo safeguard the privacy and protection of our customers personal data we must always identify the account holder by verifying full initials and surname. The agent failed to verify the customer.								\r\nA0-To safeguard the privacy of our customers personal data, an open line must be avoided at all times. An open line is considered to be uncomfortable silence, caused by the agent, that exceeds 20 seconds. The agent should keep the conversation flowing.', 'Comment', NULL, 1, 9, 2018, '2018-09-07 13:58:42'),
