(783, 38, 60, 2, 'Failures Identified:\r\n1.	Capitalisation Error (Incorrect: Safety Deposit Boxes  /  Correct: safety deposit boxes) (Only names should be capitalised)\r\n\r\nAdditional Notes:\r\n1.	Please double-check the formatting on eGain; it appears that you have double-spaces between lines.', 'Comment', NULL, 2, 9, 2018, '2018-09-12 09:44:50'),
(784, 35, 60, 2, 'Failures Identified:\r\n1.	Salutation Error (Incorrect: Dear Mr Govender   /  Correct: Dear Miss Govender) \r\n2.	Punctuation Error (A required colon was omitted in front of a list of bullet points)\r\n3.	FPOC Error (Be careful not to ask something as a security question that the customer has already answered in the first email; this creates the impression that you did not take the time to read the customer’s email properly. As an example: you have asked the customer to confirm their email address, however, you can already see what the email address is, as this was the address where the query was received form)\r\n\r\nAdditional Notes:\r\n1.	Double-check the formatting on eGain; it looks like you are placing double-spaces between lines.', 'Comment', NULL, 2, 9, 2018, '2018-09-12 10:14:10'),
(785, 39, 60, 2, 'Failures Identified:\r\n\r\n1.	FPOC Error (The customer asked for statements for all account; in addition, the request was also to have all the statements stamped. These requests were not complied with. In the customer’s second email, he mentioned that not all the requested statements were provided and that none of the ones that were provided, were stamped. Therefore, all the requested statements should have been provided again and this time all of them should have been stamped. This means that the customer will now have to send a third email for a simple query such as copies of stamped bank statements)\r\n2.	Template not adjusted (Incorrect: attachment is /  Correct: attachments are) (Multiple attachments were added to the response; the template should have been adjusted accordingly)\r\n3.	Format Error (Please ensure that you use the same font type and-size consistently throughout you entire response)', 'Comment', NULL, 2, 9, 2018, '2018-09-12 10:52:17'),
