(790, 37, 59, 2, 'ENQ. Overseas travel			\r\nCIF: the agent did not identify that the CIF and CAML email address does not match. There is a spelling error on CIF. The agent should have referred the customer to online banking or the branch to update that email address.		\r\nNicely summarized.	\r\nWe are a financial institution therefor we need to be professional at all times. The agent did not refer to SA currency which is Rand. The agent said that the daily limit is set to five thousand and she may spend up to one million (five thousand what? One million what? Dollar, Euro, Rand?)			\r\nThe customer had to repeat herself when she said that she will be traveling to Bhali via Singapore.', 'Comment', NULL, 2, 9, 2018, '2018-09-12 13:54:06'),
