(796, 44, 59, 2, 'ENQ. CLI						\r\nUncomfortable silence exceeding 10 seconds identified	\r\nA0- A brief description (memolines) of what the call was about, must be placed on the account. The purpose of this is to protect the bank and our agents,  and to provide a clear history of all interactions with our customers as well as for auditing purposes. The agent failed to place a memoline on the customers account.', 'Comment', NULL, 2, 9, 2018, '2018-09-12 14:11:31'),
(797, 45, 59, 2, 'ENQ. Promise to Pay						\r\nThe agent did not refer the customer to the branch to update her CIF email address.			\r\nThe agent did not use the customers name during the call to ensure that the conversation is personal								\r\nThe agent did not request the customers permission to be placed on hold								\r\nA0-To safeguard the privacy of our customers personal data, an open line must be avoided at all times. An open line is considered to be uncomfortable silence, caused by the agent, that exceeds 20 seconds. The agent should keep the conversation flowing.	\r\nA0-The agent could have assisted the customer with the "Promise to Pay". It was not nessasary to transfer the customer to collections. With a promise to pay, the agents can place a note on memoline. 								\r\nRate my Service/anything else and Call ending not measured as the customer was transferred to collections. When the customer cannot pay or must make a special arrangement with regards to how this account will be paid, then the customer must be transferred to collection department.', 'Comment', NULL, 2, 9, 2018, '2018-09-12 14:15:21'),
