(1301, 35, 60, 2, 'Failures Identified:\r\n\r\n1.	Salutation Error (Incorrect: Dear Smith  /  Correct: Dear Mrs Smith) \r\n2.	Format Error (Please ensure that the same font type is used throughout the entire response)\r\n3.	Punctuation Error (When an explanation/definition/phrase occurs as an appositive, it should be set off with commas i.e. a comma pair is used at the beginning and end of an explanation/definition/phrase that serves as additional information and that has been set into the middle of something else)\r\n4.	Capitalisation Error (Names/proper nouns and/or the first letter of a sentence is capitalised)\r\n5.	Sentence Structure Error (Incorrect: Are registered  /  Correct: Are you registered)\r\n6.	Bullet List Format Error (All points in the same numbered or bulleted list should be stated in the same format i.e. it should all be in the form of statements or all in the form of questions, in order to create a consistent format. In addition, punctuation should either be consistently applied to each point, or consistently omitted from each point)\r\n7.	PFOC Error (Be careful not to ask questions for the purposes of a security check in cases where the customer has already provided the details in their initial email; this creates the impression that you did not read their email properly)\r\n8.	Template Error (Unnecessary information was not removed from the response)\r\n\r\nAdditional Notes:\r\n\r\n1.	Please double-check your formatting on eGain; because formatting was not removed, it appears as though some portions of your response have double spaces between lines', 'Comment', NULL, 3, 9, 2018, '2018-09-18 12:19:01'),
