(1387, 31, 69, 3, 'ENQ. Customer called to confirm the last transaction on the garage card.\r\nThe agent did not use the customers name during the call to ensure that the conversation is personal								\r\nA0-In line with the NCA we are by law required to provide customers with statements of accounts. We wont be able to do so, if we do not confirm and verify an email address. Furthermore the agent failed to confirm a cellphone number and email address for communication and notification purposes. Please refer to VB internal communication sent out on the 28th of June.								\r\nA0- A brief description (memolines) of what the call was about, must be placed on the account. The purpose of this is to protect the bank and our agents,  and to provide a clear history of all interactions with our customers as well as for auditing purposes. The agent failed to place a memoline on the customers account.', 'Comment', NULL, 3, 9, 2018, '2018-09-19 13:54:33'),
