(1444, 51, 59, 3, 'ENQ. Overseas notification						\r\n\r\nRemember that you must provide your customer with other means of communication and/or banking.  In the case of an overseas travel note, you can educate your customer that an overseas notification can also be communicated through an email.', 'Comment', NULL, 3, 9, 2018, '2018-09-20 12:20:33'),
