(1447, 44, 59, 3, 'ENQ. Promise-to-pay-note				\r\nA0-To safeguard the privacy and protection of our customers personal data we must always identify the account holder by verifying full initials and surname. The agent failed to verify the customer full initials.				\r\nThe customer had to repeat her email address.', 'Comment', NULL, 3, 9, 2018, '2018-09-20 12:26:39'),
(1448, 45, 59, 3, 'ENQ. Overseas note				\r\nTo safeguard the privacy and protection of our customers personal data we must always identify the account holder by verifying full initials and surname. The agent failed to verify the customer.	\r\nProfessionalism: When the SARB regulations are read to the customer, the agent must always refer to Rand, Cents and percentage. We are a financial institute and should always refer to the correct units. Just saying "5000" (five thousand) or 1000 000. (one million) or a 2.5 conversion fee, confuses the customers as they do not know if it is R5000 or 5000 dollars ect. In this case the customer stopped the agent to confirm if she was speaking about the SA Rand.\r\nThis call was not ended on a high note. The agent transferred the call to the post call survey, but the customer did not understand what she meant. The call was ended without the customer understanding what was expected of him.', 'Comment', NULL, 3, 9, 2018, '2018-09-20 12:29:06'),
(1449, 46, 59, 3, 'ENQ. Closing of card						\r\nA0-The agent did not follow the correct closing procedure. The customer should have been transferred to the Retention department or a Hotlead should have been submitted in the case where the Retention department is closed.  - Coaching done', 'Comment', NULL, 3, 9, 2018, '2018-09-20 12:42:08'),
