(1451, 48, 59, 3, 'ENQ. Debit order date to be changed						\r\nThe agent did not use the customers name during the call to ensure that the conversation is personal				\r\nThe agent exceeded the hold time of 60 seconds.', 'Comment', NULL, 3, 9, 2018, '2018-09-20 12:52:17'),
(1452, 5, 59, 3, 'ENQ. Overseas note						\r\nA0-To safeguard the privacy and protection of our customers personal data we must always identify the account holder by verifying full initials and surname. The agent failed to verify the customer.			\r\nProfessionalism: When the SARB regulations are read to the customer, the agent must always refer to Rand, Cents and percentage. We are a financial institute and should always refer to the correct units. Just saying "5000" (five thousand) or 1000 000. (one million) or a 2.5 conversion fee, confuses the customers as they do not know if it is R5000 or 5000 dollars ect. In this case the customer stopped the agent to confirm if she was speaking about the SA Rand.', 'Comment', NULL, 3, 9, 2018, '2018-09-20 13:24:08'),
