(1456, 30, 33, 4, '100% well done', 'Comment', NULL, 3, 9, 2018, '2018-09-20 13:43:28'),
(1457, 6, 59, 3, 'ENQ. CLI					\r\n	\r\nA0-To safeguard the privacy and protection of our customers personal data we must always identify the account holder by asking the customer to provide his/her full initials and surname. The agent are not allowed to verify the accountholders details by providing it to the customers. He might just be providing the details to a fraudster. (In the same breath you say to the customer that for security reasons you are going to ask the customer security questions, but for security purposes you provide the caller with the account holders initials and surname?) - note: you have been penalised for this before.								\r\nIn the same breath you say to the customer that for security reasons you are going to ask the customer security questions, but for security purposes you provide the caller with the account holders initials and surname?					\r\nA0-To safeguard the privacy of our customers personal data, an open line must be avoided at all times. An open line is considered to be uncomfortable silence, caused by the agent, that exceeds 20 seconds. The agent should keep the conversation flowing.	\r\nA0- A brief description (memolines) of what the call was about, must be placed on the account. The purpose of this is to protect the bank and our agents,  and to provide a clear history of all interactions with our customers as well as for auditing purposes. The agent failed to place a memoline on the customers account. 								\r\n\r\nCall cut - Rate my service, anything else and ending call on high note could not be measured', 'Comment', NULL, 3, 9, 2018, '2018-09-20 13:55:01'),
(1458, 29, 33, 4, '100% Good call poi', 'Comment', NULL, 3, 9, 2018, '2018-09-20 15:46:51'),
(1459, 7, 59, 3, 'ENQ. Overseas note						\r\nThe agent did not use the customers name during the call to ensure that the conversation is personal				\r\nFICA verification not memolined				\r\nA0-The SARB regulations was not provided clearly and in full.			\r\nA0-In line with the NCA we are by law required to provide customers with statements of accounts. We wont be able to do so, if we do not confirm and/or verify the correctness of an email address. Please refer to VB internal communication sent out on the 28th of June.', 'Comment', NULL, 3, 9, 2018, '2018-09-20 15:56:51'),
