(1523, 12, 59, 3, 'The agent did not use the customers name during the call to ensure that the conversation is personal				\r\nProfessionalism: When the SARB regulations are read to the customer, the agent must always refer to Rand, Cents and percentage. We are a financial institute and should always refer to the correct units. Just saying "5000" (five thousand) or 1000 000. (one million) or a 2.5 conversion fee, confuses the customers as they do not know if it is R5000 or 5000 dollars ect. In this case the customer stopped the agent to confirm if she was speaking about the SA Rand.\r\nThe agent did not provide the customer the opportunity to rate our service.', 'Comment', NULL, 3, 9, 2018, '2018-09-21 11:07:07'),
