(1525, 11, 59, 3, 'The agent did not use the customers name during the call to ensure that the conversation is personal			\r\nFICA verification not memolined	\r\nA0-In line with the NCA we are by law required to provide customers with statements of accounts. We wont be able to do so, if we do not confirm and verify an email address. Furthermore the agent failed to confirm a cellphone number and email address for communication and notification purposes. Please refer to VB internal communication sent out on the 28th of June.	\r\nThis call was not ended on a high note. Please end the call on a high note even if you will be transferring the customer to the post call survey.', 'Comment', NULL, 3, 9, 2018, '2018-09-21 11:16:29'),
