(1532, 21, 59, 3, 'ENQ. Overseas note						\r\nA0-To safeguard the privacy and protection of our customers personal data we must always identify the account holder by verifying full initials and surname. The agent failed to verify the customer.								\r\nA0-The agent only obtained 2 correct answers out of 3 security questions asked.	\r\nThe agent did not use the customers name during the call to ensure that the conversation is personal								\r\n				\r\nA0- A brief description (memolines) of what the call was about, must be placed on the account. The purpose of this is to protect the bank and our agents,  and to provide a clear history of all interactions with our customers as well as for auditing purposes. The agent failed to place a memoline on the customers account. 	\r\n\r\nSARB regulations incorrectly confirmed: \r\n1.	SA Residents who are over the age of 18 years going abroad may spend up to R1million per calendar year. \r\na.	please refer to rand and cents. It is not one million per calendar year, it is one million rand, per calendar year \r\n\r\n2.	There is a R5000.00 ATM cash withdrawal limit per day. \r\na.	please refer to rand and cents. It is not "five thousand" it is "five thousand rand - the customers might think is dollar or euro for example.\r\n\r\n3.	The customer may visit any branch with foreign exchange capabilities for cash withdrawals greater than R5000.00 \r\na.	You did not mention this to the customer.\r\n\r\n4.	There is a R60.53 cash withdrawal fee, irrespective of the amount withdrawn at an ATM or Branch  (R25.22 for VMSA Cardholders) \r\na.	You said to the customer the withdrawal fee is R60.00 - this is incorrect information provided to the customer.\r\n\r\n5.	There is a 2.75% conversion fee for all swipe transactions \r\na.	Please refer to percentage. The customers dont know what is 2.75, but they will understand if you say 2.75%  (percent) conversion fee\r\nThis call was not ended on a high note. Please end the call on a high note even if you will be transferring the customer to the post call survey.', 'Comment', NULL, 3, 9, 2018, '2018-09-21 12:20:43');
