(1533, 24, 59, 3, 'A0-To safeguard the privacy and protection of our customers personal data we must always identify the account holder by asking the customer to provide his/her full initials and surname. The agent are not allowed to verify the accountholders details by providing it to the customers. He might just be providing the details to a fraudster.						\r\nFICA verification not memolined	\r\nThe agent did not use the customers name during the call to ensure that the conversation is personal', 'Comment', NULL, 3, 9, 2018, '2018-09-21 12:36:44'),
