(1536, 25, 59, 3, 'The call was cut.\r\nRate my service/anything else and Call ending not measured as the call cut								\r\nNote: the call was cut before it was concluded, there might have been a possibility for the customer to express a compliment in spite of the bad signal on the call, the agent persevered and did as much as could be done.', 'Comment', NULL, 3, 9, 2018, '2018-09-21 12:57:51'),
