INSERT INTO `question` (`question_id`, `description`, `evaluation`, `cat_id`, `weight`, `is_parent`, `has_child`, `answer_id`, `count`, `parent_id`, `no_answer`, `date_added`, `status`) VALUES
(1, 'Was the customer''s need/s fully addressed?', '', 1, '6.66', 0, 0, 0, 0, 0, 3, '2018-07-30 09:33:57', 0),
(2, 'Was the customer provided with the best solution possible?', 'Was the most efficient and effective method used to solve the customer''s problem?', 1, '6.66', 0, 0, 0, 0, 0, 2, '2018-07-30 09:34:55', 0),
(3, 'Did they go above and beyond the stated need?', '', 1, '5.00', 0, 0, 0, 0, 0, 2, '2018-07-30 09:48:27', 0),
(4, 'Are there alternative channels applicable for this type of request?', '', 1, '2.50', 0, 1, 0, 0, 0, 2, '2018-07-30 09:49:31', 0),
(5, 'Was the customer informed of alternative channels available to meet this request?', 'As per the omnichannel strategy - was the customer informed of  the various ways in which they can do their banking? E.g. internet banking, mobile apps, emails, chat, etc.', 1, '2.50', 1, 0, 8, 0, 4, 2, '2018-07-30 09:50:53', 0),
(6, 'Could the query be resolved at the first point of contact?', 'Was the problem solved completely during this interaction being assessed i.e. it did not generate a follow-up email and there was minimal need for call-back and/or follow up via email, ensuring minimal effort for customer.', 2, '2.50', 0, 1, 0, 0, 0, 2, '2018-07-30 09:56:24', 0),
(7, 'Was the query resolved at the first point of contact?', '', 2, '2.50', 1, 0, 12, 0, 6, 2, '2018-07-30 10:02:29', 0),
(8, 'Could the email survey be attached?', '', 2, '2.00', 0, 1, 0, 0, 0, 2, '2018-07-30 10:03:17', 0),
(9, 'Was the survey link attached?', '', 2, '2.00', 1, 0, 16, 0, 8, 2, '2018-07-30 10:04:12', 0),
(10, 'Was plain and simple language used when writing to the customer?', 'Was the language used clear and articulate? No bank jargon was used.', 2, '6.66', 0, 0, 0, 0, 0, 2, '2018-07-30 10:05:05', 0),
(11, 'Was authentication necessary?', 'Was this just a general enquiry? If not, Did the customer provide their account #, ID #, address and contact details?', 3, '3.00', 0, 1, 0, 0, 0, 2, '2018-07-30 10:06:11', 0),
(12, 'Was authentication done correctly?', '', 3, '3.00', 1, 0, 22, 0, 11, 2, '2018-07-30 10:06:47', 0),
(13, 'If applicable, did the information provided by the customer match our systems?', 'Did the agent compare the information given by the caller during the authentication to the information on the system, and ensure that they matched?', 3, '2.50', 0, 0, 0, 0, 0, 2, '2018-07-30 10:07:57', 0),
(14, 'Was the FAIS policy adhered to by not providing financial advice to the customer?', '', 3, '6.66', 0, 0, 0, 0, 0, 2, '2018-07-30 10:08:38', 0),
(15, 'If applicable, was the customer''s personal information removed from the Email trail?', '', 3, '2.50', 0, 0, 0, 0, 0, 2, '2018-07-30 10:09:09', 0),
(16, 'Was the email correctly addressed and introduction correct?', 'For example Dear Mr Customer, thank you for your email.', 4, '6.66', 0, 0, 0, 0, 0, 2, '2018-07-30 10:10:33', 0),
(17, 'Was the email layout correct?', 'The correct format used and line spacing applied consistently. Was clear and consistent sentence structure, word/line spacing and appropriate word choice used.', 4, '6.66', 0, 0, 0, 0, 0, 2, '2018-07-30 10:11:03', 0),
(18, 'Were templates correctly adjusted when used?', 'If a template was used, correct editing or adjustments need to be made to ensure that the feedback is relating to the customer''s query.', 4, '6.66', 0, 0, 0, 0, 0, 2, '2018-07-30 10:11:27', 0),
(19, 'Was one language used throughout the email?', '', 4, '6.66', 0, 0, 0, 0, 0, 2, '2018-07-30 10:12:29', 0),
(20, 'Was punctuation, spelling, capital letters and grammar used correctly?', 'Was clear and consistent sentence structure, word/line spacing and appropriate word choice used.', 4, '6.66', 0, 0, 0, 0, 0, 2, '2018-07-30 10:13:03', 0),
(21, 'Was the correct date and amount format used?', 'E.g. 1 January 2018 and R1 234,56', 4, '6.66', 0, 0, 0, 0, 0, 2, '2018-07-30 10:13:53', 0),
(22, 'Was the correct signature used?', 'As per email signature policy', 4, '6.66', 0, 0, 0, 0, 0, 2, '2018-07-30 10:14:21', 0),
